import React, { Component } from 'react'
import '../css/App.css';
import Navbar from './Navbar.jsx'
import Sorting from './Sorting.jsx'
import Graphs from './Graphs.jsx' 
import PathFinding from './PathFinding.jsx'

export default class App extends Component{
    constructor(props) {
        super(props)
        this.state = {
            sorting: true,
            graphs: false,
            pathFinding: false
        }

        this.changePage = this.changePage.bind(this)
    }

    changePage(page) {
        console.log("Worked");
        let sorting = false
        let graphs = false
        let pathFinding = false
        if (page === "sorting") {
            sorting = true
        } else if (page === "graphs") {
            graphs = true
        } else if (page === "path-finding") {
            pathFinding = true
        }
        this.setState({
            sorting: sorting,
            graphs: graphs,
            pathFinding: pathFinding
        })
    }

    render () {
        return  (
        <div className = "App" >
            <Navbar changePage={this.changePage}></Navbar>
            {this.state.sorting ? <Sorting/> : null}
            {this.state.graphs ? <Graphs/> : null}
            {this.state.pathFinding ? <PathFinding/> : null}
        </div>
        )

    }
}
